member.remarks:
Below is the JSON schema for the request and response payloads.

Request Body:

Schema for AppComponentsMap:
{
  resourceId: string, # Optional. Azure Load Testing resource Id
  testId: string, # Optional. [Required, if testRunId is not given] Load test unique identifier
  testRunId: string, # Optional. [Required if testId is not given] Load test run unique identifier
  name: string, # Optional. AppComponent name
  value: Dictionary<string, AppComponent>, # Required. AppComponents Map { resource id (Fully qualified resource Id e.g subscriptions/{subId}/resourceGroups/{rg}/providers/Microsoft.LoadTestService/loadtests/{resName}) : resource object } 
}


Response Body:

Schema for AppComponentsMap:
{
  resourceId: string, # Optional. Azure Load Testing resource Id
  testId: string, # Optional. [Required, if testRunId is not given] Load test unique identifier
  testRunId: string, # Optional. [Required if testId is not given] Load test run unique identifier
  name: string, # Optional. AppComponent name
  value: Dictionary<string, AppComponent>, # Required. AppComponents Map { resource id (Fully qualified resource Id e.g subscriptions/{subId}/resourceGroups/{rg}/providers/Microsoft.LoadTestService/loadtests/{resName}) : resource object } 
}

